import styled from "styled-components";

const Boton = styled.button`
.button{
    -webkit-transition-duration: 0.4s; /* Safari */
    transition-duration: 0.4s;
}

.button:hover {
    background-color: #81638b; /* morado*/
    color: #503459;
}
`;

export default Boton;
